insert or ignore into album_artist_link(album_artist_id, album_id, song_id)
values(
    (select album_artist_id from album_artist where album_artist_name = ? limit 1), 
    (select album_id from album where album_name = ? limit 1),
    (select song_id from song where song_path = ? limit 1)
);
